object Solution {
    def maximumTripletValue(nums: Array[Int]): Long = {
        var maxProduct = 0L
        for (i <- nums.indices) {
            var maxI = Long.MinValue
            var maxK = Long.MinValue
            for (j <- 0 until i) {
                maxI = math.max(maxI, nums(j) - nums(i))
            }
            for (k <- i + 1 until nums.length) {
                maxK = math.max(maxK, nums(k))
            }
            if (maxI > 0 && maxK > 0) {
                maxProduct = math.max(maxProduct, maxI * maxK)
            }
        }
        maxProduct
    }
}
